import React from 'react'
import { Container } from 'semantic-ui-react'


const aboutmetext1 = "My name is Shervin, 24, living in Munich, Germany. I've been studying Computer Science and I'm mostly interested\
 in Computer Vision area, but lately I've found a new area which is more releveant to my passion, \"Sonification\". "

 const aboutmetext2 = "I also play different music instruments and I always like to try any new one, so I would never say no when I\
 see a friend with a new instrument. I pick it up and try to make a sound of it. But more professioanly I play the Piano and Setar, an Iranian\
 music instrument.";

 const aboutmetext3 = "p.s.: The picture on top of this page was added just for fun during deveoplment of the page, and after I was done with\
 coding, I didn't find anything better to replace it, so I decided to keep it as it is.";

 const aboutmetext4 = "If you are in Munich and play Tennis, or have some ideas regarding musics/informatics that you think we might \
 be able to cooporate, feel free to conatact me.";

const AboutMe = () => (

  <Container text className="post">
    <br/>
    <p className='nicep'>
      {aboutmetext1}
    </p>
    <p>
      {aboutmetext2}
    </p>
    <p>
      {aboutmetext4}
    </p>
    <p>
      {aboutmetext3}
    </p>
  </Container>
)

export default AboutMe
